import { Link } from "react-router-dom";
import logo from "../logo.png";
import jwtDecode from "jwt-decode";
function Layout(props){
 let jwt = localStorage.getItem('tokensesion');
 let tokenDecodificado = jwtDecode(jwt);
 console.log(tokenDecodificado);
return(
    <div className="container-fluid">
    <header className="bg-dark row col-12">
      <div className="text-white text-end col-11">contacto</div>
      {
        jwt != null ? (
          <Link className="text-white col-1" to='/logout'>{tokenDecodificado.email}</Link>
        ) : (
          <Link className="text-white col-1" to='/login'>login</Link>
        )
      }
    </header>
    <nav className="navbar navbar-expand-sm bg-light col-12 ">
      <ul className="navbar-nav col-12 d-flex flex-row justify-content-around">
        <li className="nav-item ">
          <img className="d-block" src={logo} alt="Logo de Agapea" ></img>
        </li>
        <li className="nav-item">
          <form className="d-flex">
            <input className="form-control me-1" type="search" placeholder="Buscar por libro, autor, ISBN..." aria-label="Search"/>
            <button className="btn btn-success" type="submit">Search</button>
          </form>
        </li>
      </ul>
    </nav>
    <main>
        {props.children}
    </main>
    </div>
)
}
export default Layout;
